const axios = require('axios');
const mongoose = require('mongoose');

const express = require('express');
const router = express.Router();
const Imagen = require('../models/imagen');

const personData = "data:image/jpeg;base64,"


const numData = "data:image/webp;base64,"


const animalData = "data:image/jpeg;base64,"

router.get('/:username', async(req, res) => {
    console.log(req.query)
    const username = req.params.username;
    const pagina = req.query.pagina;
    const ordenar = req.query.ordenar;
    const tipoDeModelo = req.query.tipoDeModelo;
    const buscador = !(req.query.buscador) ? '': req.query.buscador;

    let ImagenPruebaPersona = {
        "_id":"prueba",
        "name":"Persona.jpg",
        "fechaDeGuardado": new Date("Sat Jun 28 2022 12:00:00"),
        "image": personData,
        "tipoDeModelo":"hombresYmujeres",
        "usernameAsociated":username
    } 

    let ImagenPruebaAnimal = {
        "_id":"prueba",
        "name":"Animal.jpg",
        "fechaDeGuardado": new Date("Sat Jun 28 2022 12:00:00"),
        "image": animalData,
        "tipoDeModelo":"hombresYmujeres",
        "usernameAsociated":username
    } 

    let ImagenPruebaNumero = {
        "_id":"prueba",
        "name":"Número.jpg",
        "fechaDeGuardado": new Date("Sat Jun 28 2022 12:00:00"),
        "image": numData,
        "tipoDeModelo":"numeros",
        "usernameAsociated":username
    } 
   
    try {
        let imagenesDB = {}
        
        imagenesDB = await Imagen.find({"tipoDeModelo":tipoDeModelo,"usernameAsociated":username,"name": {$regex : buscador, $options:"i"}}).skip(9*pagina).limit(9)
        var total =  await Imagen.countDocuments({"tipoDeModelo":tipoDeModelo,"usernameAsociated":username,"name": {$regex : buscador, $options:"i"}});

        if(ordenar){
            imagenesDB = await Imagen.find({"tipoDeModelo":tipoDeModelo,"usernameAsociated":username,"name": {$regex : buscador, $options:"i"}}).sort({[ordenar[0]]:ordenar[1]}).skip(9*pagina).limit(9)
        }
        if(tipoDeModelo == "hombresYmujeres" && ImagenPruebaPersona.name.includes(buscador) && pagina==0){
            imagenesDB.splice(0, 0, ImagenPruebaPersona);
        }
        if(tipoDeModelo == "numeros" && ImagenPruebaNumero.name.includes(buscador) && pagina==0){
            imagenesDB.splice(0, 0, ImagenPruebaNumero);
        }
        if(tipoDeModelo == "perrosYGatos" && ImagenPruebaAnimal.name.includes(buscador) && pagina==0){
            imagenesDB.splice(0, 0, ImagenPruebaAnimal);
        }

        res.json({
            imagenesDB,
            total
        });
    } catch (error) {
        return res.status(400).json({
        mensaje: 'An error has occurred',
        error
        })
    }
});

router.post('/', async(req, res) => {
    const body = req.body; 
    try {
        body._id = new mongoose.Types.ObjectId();
        console.log("Posting a new image")
        const imagenDB = await Imagen.create(body);
        res.status(200).json(imagenDB); 
    } catch (error) {
        console.log("Error::", error)
        return res.status(500).json({
            mensaje: 'An error has occurred',
            error
        })
    }
});

router.delete('/:imgId', async (req, res) => {
    const _Id = req.params.imgId;
    try {
        const ImagenDB = await Imagen.findOneAndRemove({ "_id": mongoose.Types.ObjectId(_Id) });
        res.status(200).json(ImagenDB);
    } catch (error) {
        return res.status(400).json({
            mensaje: 'An error has occurred',
            error
        })
    }
})

router.delete('/deleteImagesByUser/:username', async (req, res) => {
    const username = req.params.username;
    try {
        const ImagenDB = await Imagen.deleteMany({usernameAsociated: {$eq : username}})
        res.status(200).json(ImagenDB);
    } catch (error) {
        return res.status(400).json({
            mensaje: 'An error has occurred',
            error
        })
    }
})

module.exports = router;